.detailsView {
    width: 100%;
    height: 100%;
    padding: 16px;
    background: #fff;
    border-radius: 8px;
    .basicinfo {
        .title {
            font-size: 16px;
            color:#79ac43;
            line-height: 22px;
            display: flex;
            align-items: center;
            i {
                width: 12px;
                height: 12px;
                border-radius: 2px;
                background: #79ac43;
                margin-right: 8px;
            }
        }
        .content {
            padding: 16px;
            background: #fafafa;
            .name {
                font-size: 16px;
                color: #202224;
            }
            .details {
                display: flex;
                font-size: 14px;
                color: #4d4e50;
                margin-top: 16px;
                .left {
                    width: 50%;
                    p {
                        height: 20px;
                        margin: 0 0 8px 0;
                        display: flex;
                        align-items: center;
                        .label {
                            width: 100px;
                        }
                    }
                }
            }
        }
    }
}
